), tt2 as (

    SELECT
        tt1.folder
        , decode(tt1.filename, 'deleteme', NULL, tt1.filename) AS filename
        , decode(tt1.sftp, 'deleteme', NULL, tt1.sftp)         AS sftp
    FROM tt1
), tt3 as (

    SELECT DISTINCT

          replace(folder, '#', '\\')                                     AS folder
        , first_value(filename)
          OVER (
              PARTITION BY folder
              ORDER BY filename NULLS LAST
              ROWS BETWEEN UNBOUNDED PRECEDING AND UNBOUNDED FOLLOWING ) AS filename
        , first_value(sftp)
          OVER (
              PARTITION BY folder
              ORDER BY sftp NULLS LAST
              ROWS BETWEEN UNBOUNDED PRECEDING AND UNBOUNDED FOLLOWING ) AS sftp


    FROM tt2
)

select
    tt3.folder
    , tt3.filename
    , replace(regexp_substr(filename, '(default_value="[^"]*)'),'default_value="','') as clean_filename
    , tt3.sftp
    , replace(regexp_substr(sftp, '(default_value="[^"]*)'),'default_value="','') as clean_sftp
from tt3
where folder not like '%rchive%' and folder  not like '%deprecated%' and folder  not like '%rp-dev%'

;
